(function ($, window, Drupal) {
  'use strict';

  Drupal.behaviors.footerNewsletterSubscriptions = {
    attach: function attach(context, settings) {

      // Set padding dynamically.
      Drupal.behaviors.footerNewsletterSubscriptions.updatePaddingHeight();
      window.onresize = Drupal.behaviors.footerNewsletterSubscriptions.updatePaddingHeight;

      var $container = $('.main-footer__newsletter-email', context);
      if ($container.find('input[name="email_address"]').val() !== '') {
        $container.find('label').addClass('active');
      }

      $container.on('click', function () {
        var $label = $(this).find('label');
        var $input = $(this).find('input[name="email_address"]');

        if ($label.hasClass('active')) {
          return false;
        }

        // Show recaptcha widget if it was not opened yet.
        var footerLabel = $('.main-footer__newsletter-email label');
        if (!footerLabel.hasClass('with-recaptcha-widget') && !footerLabel.hasClass('with-recaptcha-message')) {
          setTimeout(function () {
            var newsletterId = $('.main-footer input[name="newsletter_id"]').val();
            var siteKey = settings.cfrNewsletter.recaptcha.siteKey;
            var recaptchaId = window.grecaptcha.render(newsletterId, { sitekey: siteKey });
            // Position label correctly with recaptcha open.
            $('.main-footer__newsletter-email label').addClass('with-recaptcha-widget');
            // Set recaptcha id value into hidden field to make it accessible in backend.
            $('#' + newsletterId + '--recaptcha-id').val(recaptchaId);
            // To avoid overlap after showing recaptcha widget update padding.
            Drupal.behaviors.footerNewsletterSubscriptions.updatePaddingHeight();
          }, 0);
        }

        $label.addClass('active');
        $input.focus();

        $input.on('blur', function () {
          if (!$input.val()) {
            $label.removeClass('active');
            $container.removeClass('invalid');
          }
        });
      });
    }
  };

  Drupal.behaviors.footerNewsletterSubscriptions.updatePaddingHeight = function () {
    var bodyClipOverflow = document.querySelector('.body-clip-overflow');
    var $footer = document.querySelector('.main-footer');

    if (!$footer) {
      return;
    }

    var footerHeight = $footer.clientHeight;
    bodyClipOverflow.style.paddingBottom = footerHeight + 'px';
  };

  /**
   * We need to add a class and update padding.
   *
   * @name footerResize
   */
  Drupal.AjaxCommands.prototype.footerResize = function () {
    setTimeout(function () {
      // Position label correctly with recaptcha open.
      $('.main-footer__newsletter-email label').addClass('with-recaptcha-widget');
      // To avoid overlap after showing recaptcha widget update padding.
      Drupal.behaviors.footerNewsletterSubscriptions.updatePaddingHeight();
    }, 0);
  };

  /**
   * Change label classes to show recaptcha error message.
   *
   * @name footerRecaptchaMessage
   */
  Drupal.AjaxCommands.prototype.footerRecaptchaMessage = function () {
    setTimeout(function () {
      var label = $('.main-footer__newsletter-email label');
      var submitbtn = $('.main-footer__newsletter-submitbtn');
      label.removeClass('with-recaptcha-widget');
      label.addClass('with-recaptcha-message');
      submitbtn.addClass('btn-with-recaptcha-message');
    }, 0);
  };

  /**
   * Change label classes to show recaptcha error message email.
   *
   * @name footerAddEmailErrorDiv
   */

  Drupal.AjaxCommands.prototype.footerAddEmailErrorDiv = function () {
    setTimeout(function () {
      var oldEmailErrorElement = $('#daily_news_brief_main-footer_form--form-error').clone();
      var emailElement = $('#edit-email-address');
      $('#daily_news_brief_main-footer_form--form-error').remove();
      oldEmailErrorElement.insertAfter(emailElement);
    }, 1);
  };
})(jQuery, window, Drupal);

